package com.brazedblue.intervox.dicom;import com.brazedblue.intervox.util.*;class DicomElementFilter /* implements anInterface */ {  private String[] fAcceptedTagStrings = null;  public DicomElementFilter(String[] acceptedTagStrings) {    fAcceptedTagStrings = acceptedTagStrings;  }  public boolean CanIgnore(DicomElementHeader header, Object value) {    if (fAcceptedTagStrings != null) {      String tagString = header.GetTagString();      return !NeuroSynchUtil.StrArrayContainsString(fAcceptedTagStrings, tagString);    } else {      return false;    }  }}